import React, {Component} from 'react';
import {Button, Header, Container} from 'semantic-ui-react';

class Nav extends Component{
    render(){
        return(
            <div>
                <Segment raised>
                    <Container>
                        <Header></Header>
                        <Header size="medium">Name: Patient's Name</Header>
                    <p>April 18, 1995 | Male</p>
                    <p>3rd St., 3rd Blk., Auread Subd., City of San Fernando</p>

                    <Button color="blue">Edit Information</Button>


                    </Container>
                </Segment>



            </div>
        );
    }
}

export default Nav;
